script: |
  super -f text -I q5485.spq | sort > q5485.out

inputs:
  - name: q5485.spq
    data: |
      SELECT DISTINCT - col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE ( NULL ) NOT BETWEEN + - col1 AND + - CAST ( - 64 AS INTEGER ) * - col1 + CAST ( col1 AS INTEGER );
  - name: tab2

outputs:
  - name: q5485.out
    data: |
